    {props.data.map(e => 
    <ToddoChildren 
    key={e.id} 
    id={e.id} 
    onDelete={props.onDelete}
    >
      {/* <li className="arrange-order" key={e.id} id={e.id} onDeleteEvent={props.onDelete}>
        {e.text}
        {e.id}

      </li> */}
      {e.text}<BsXCircleFill />
      </ToddoChildren>
    )}


    </ul>
</div>

  )
}

export default ToddoList
